import Card from "../Components/Card"

export default function Home() {

    const { movies, setMovie } = useContext(StoreContext)

    return (
        <div>
            <Header/>
            <h1>List Movies</h1>
            {
                movies.map((movie, index) => {
                    return (
                        <div>
                            <p>{movie.title}</p>
                        </div>
                    )
                })
            }
        </div>
    )

}
